import React from "react";
import { Image, Grid, Dropdown, Menu } from "semantic-ui-react";
export default function brands() {
  const friendOptions = [
    {
      key: "Acer",
      text: "Acer",
      value: "Acer",
    },
    {
      key: "Adata",
      text: "Adata",
      value: "Adata",
    },
    {
      key: "Apple",
      text: "Apple",
      value: "Apple",
    },
  ];

  return (
    <div>
      <Grid>
        <Grid.Column width={4}>
            <h4>Tüm Markalar</h4>
          <Dropdown
            placeholder="Marka seçiniz"
            openOnFocus
            selection
            options={friendOptions}
          />
        </Grid.Column>
        <Grid.Column width={12}>
          <Image src="images/markalar1.PNG" centered />
        </Grid.Column>
      </Grid>
    </div>
  );
}
